Channel Description:
LeCoinStat est une chaîne ayant pour but de vulgariser les métiers du monde de la data.
Vous trouverez sur cette chaîne des vidéos sur:

-Des concepts et méthodes du monde de la data;
-Des tutoriels sur des logiciels utilisés pour travailler sur les données;
-Des interviews avec des professionnels de divers secteurs d'activité;
-Des conseils pour obtenir un emploi, un stage, une alternance etc.
